import React from "react";
import axios from "axios";

const GeneratePDFButton = ({ eventId, rounds }) => {
  const generatePDF = async () => {
    try {
      // You can use the rounds data passed to this component
      console.log("Generating PDF with rounds:", rounds);
      const response = await axios.post("http://localhost:3000/generate-pdf", {
        eventId,
        rounds,
      });

      // Handle the response, e.g., downloading the PDF
      console.log("PDF generated:", response.data);
    } catch (error) {
      console.error("Error generating PDF:", error);
    }
  };

  return (
    <button className="btn btn-warning mt-3" onClick={generatePDF}>
      Generate PDF
    </button>
  );
};

export default GeneratePDFButton;
